import './ExpenseItem.css';
function ExpenseItem() {
    const expenseDate=new Date(2023,8,24)
    const expenseTitle= 'Cosas comprables'
    const expenseAmount= 20.43
   return (
       <div className="expense-item">
           <div>{expenseDate}</div>
           <div className="expense-item__decription">
               <h2>Cosas comprables</h2>
               <div className="expense-item__price">$20.43</div>
           </div>
       </div>
   );

}
export default ExpenseItem;
